import React from "react";
import { UpperPartPages } from "../../general_compo/reusable_operations/UpperPartPages";
import { useEffect } from "react";
import { httpService } from "../../../services/httpService";
import { Reusable_table2 } from "../../general_compo/reusable_table/reusable_table2/Reusable_table2";
import { useState } from "react";
export const ProductManagement = () => {
  const [data, setData] = useState();

  const getAllProducts = async () => {
    const res = await httpService("api/admin/products", "get");
    console.log(res.data.data);
    setData(res.data.data);
  };

  useEffect(() => {
    getAllProducts();
  }, []);

  const headers_productTable = [
    { field: "categories", title: "گروه محصولات" },
    { field: "title", title: "عنوان" },
    { field: "price", title: "قیمت" },
    { field: "stock", title: "موجودی" },
    { field: "operation", title: "عملیات" },
  ];

  return (
    <>
      <div className="px-4 productGroupManagement">
        <UpperPartPages title="مدیریت محصولات" />
        <Reusable_table2
          nameOfColumn={headers_productTable}
          dataOfRows={data}
        />
      </div>
    </>
  );
};
